import React, { useState } from "react";
import Dialog from "@mui/material/Dialog";
import DialogActions from "@mui/material/DialogActions";
import DialogContent from "@mui/material/DialogContent";
import DialogContentText from "@mui/material/DialogContentText";
import DialogTitle from "@mui/material/DialogTitle";
import MDButton from "components/MDButton";
export default function MeetingModal({ formData, handleClose, show }) {
  const [newForm, setForm] = useState({
    student_name:"Jegan",
    alumni_name:formData.alumni_name,
    meeting_request:""
  })
  return (
    <div>
      <Dialog
        open={show}
        PaperProps={{
          sx: {
            width: "800px", // Adjust the width to your desired size
            maxWidth: "none", // Ensure the max width is not constrained
          },
        }}
        onClose={handleClose}
      >
        <DialogTitle>Staff Details</DialogTitle>
        <DialogContent>
          <Box
            component="form"
            sx={{
              "& .MuiTextField-root": { m: 2, width: "100ch" },
            }}
            noValidate
            autoComplete="off"
          >
            <TextField
              required
              id="outlined-required"
              label="Student Name"
              disabled
              value={formData.cname}

            />
            <br></br>
            <TextField
              required
              id="outlined-required"
              label="Alumni  Name"
              disabled
              value={formData.alumni_name}

            />
             <TextField
          id="outlined-multiline-static"
          label="Multiline"
          multiline
          rows={4}
          onChange={(e) => {
            setFormData({...formData,meeting_request:e.target.value})
          }}
          defaultValue="Default Value"

            />
            <TextField
              required
              id="outlined-required"
              type="date"
              label="Open date"
              placeholder="Open date"
              value={formData.open_date}
              onChange={(e) => {
                setFormData({ ...formData, open_date: e.target.value });
              }}
            />
            <TextField
              required
              id="outlined-required"
              type="date"
              label="End date"
              placeholder="end date"
              value={formData.close_date}
              onChange={(e) => {
                setFormData({ ...formData, close_date: e.target.value });
              }}
            />
          </Box>
        </DialogContent>

        <DialogActions>
          <MDButton onClick={handleClose} color="primary">
            Close
          </MDButton>
        </DialogActions>
      </Dialog>
    </div>
  );
}
